def complement_bases(m):
	ret=""

	for i in range(0,len(m)):
		if(m[i]=='A'):
			ret+=str('T')
		elif(m[i]=='T'):
			ret+=str('A')
		elif(m[i]=='C'):
			ret+=str('G')
		elif(m[i]=='G'):
			ret+=str('C')

	return ret

s=""
l=[]
